#include "dataReport.h"

/* PNG */
static const wxString s_report_64_png = wxT("");

wxIcon CMetaObjectReport::GetIcon() const
{
	return GetIconGroup();
}

wxIcon CMetaObjectReport::GetIconGroup()
{
	static wxIcon icon =
		CBackendPicture::GetIconFromBase64(s_report_64_png, wxSize(16, 16));

	return icon;
}
